    const careerdata = (e) => {
        console.log(e);
    }

    const formdatasubmit = (e) => {
        console.log(e);
    }

    return (
        <>
            <div className="career_apply_popup" id='careermodelopen'>
                <div className="career_applay_model">
                    <div style={{ padding: '30px',position:'relative' }}>
                        <div style={{position:'absolute',right:'40px',cursor:'pointer',fontSize:'25px'}}>
                            <i class="fas fa-times"></i>
                        </div>
                        <div>
                            <div className="u-size-30">
                                <div className="u-layout-row">
                                    <div className="u-container-style u-layout-cell u-size-60 u-layout-cell-1">
                                        <div className="u-container-layout u-valign-middle u-container-layout-1">
                                            <h2 className="u-align-center u-custom-font u-text u-text-1 laravel_uiux_disk_title">why choose Android</h2>
                                            <div className="laravel_uiux_border">
                                                <div style={{ width: '80px', margin: 'auto', background: 'white' }}>
                                                    <i className="fas fa-diamond" />
                                                    <i className="fas fa-diamond" />
                                                    <i className="fas fa-diamond" />
                                                </div>
                                            </div>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </div>
                        <div>

                        </div>
                        <div />
                    </div>
                </div>
            </div>
        </>
    )
}

export default Career
